css:
.travis-ci-status .build-status {
  cursor: pointer;
}
.travis-ci-status .build-matrix .builds {
  padding-left: 20px;
}
.travis-ci-status .icon:before {
  font-size: 14px;
  width: 14px;
  height: 14px;
  position: relative;
  top: 1px;
  margin-right: 0px;
}
.pending {
  color: #ff982d;
}
.success {
  color: #529b2f;
}
.fail {
  color: #cc0000;
}
